import React from "react";
import {Link} from "react-router-dom";
import './Navbar.css'

const  Navbar = () =>{
    return(
        <div>
            <ui className="navbar">

                <li>
                    <Link to="/">Home page</Link>
                </li>
                        
                <li>
                    <Link to="contactus"></Link>
                </li>

                <li>
                    <Link to="aboutus"></Link>
                </li>

                {/* <li>
                    <Link to="/"><LinkButton text='Home Page'/></Link> 
                </li> */}



            </ui>
        </div>
    );
}

export default Navbar
